EXP-ColGridList.css_string:
.EXP-ColGridList {
    /*-ctag-example: ...
            { .EXP-ColGridList__row  }
            { .EXP-ColGridList__separator  }
            { .EXP-ColGridList__row  }
            { .EXP-ColGridList__separator }
            { .EXP-ColGridList__row  }
            { .EXP-ColGridList__separator }
    */
    .fill-container;
    overflow: scroll;
    overflow-x: hidden;

    .float-left;

    &__row {
        /*-ctag-example: ...
            { .EXP-ColGridList__cell }
            { .EXP-ColGridList__cell }
            { .EXP-ColGridList__cell }
        */
        .height-row;
        .fill-width;

        &--large {
            .height-row-1-half;
        }
    }

    &__cell {
        /*-ctag-example: <div class='EXP-ColGridList__cell width-col-2'>Cell</div>*/
        .fill-height;
        .flex-vcenter;
        .float-left;
        border-left: 1px solid @grey-9;
        .font-size;

        & > div {
            .fill-width;
            .h-padding-col-quarter;
        }

        &:first-child {
            .margin-left-col-half;
            border-left: 0px;

            .skinny-margin-left-col-quarter;
            .breakpoint-small-margin-left-col-quarter;

            & > div {
                padding-left: 0px;
            }
        }

        &:last-child {
            margin-right: -@col-half;
        }
    }

    &__separator {
        /*-ctag-example: ...*/
        height: 1px;
        .fill-width;
        clear: both;
        .h-padding-col-half;

        .skinny-h-padding-col-quarter;
        .breakpoint-small-h-padding-col-quarter;

        & > div {
            .fill-container;
            .background-grey-9;
        }

    }
}

EXP-Page.css_string:
.EXP-Page {
    /*-ctag-example: ...
            { .EXP-advisor__header  }
    */
    .fill-container;
    .background-grey-10;

    .shadow-left;
    // transition: width .3s, left .3s;

    transition: left .3s;
    .skinny {
        transition: width .3s, left .3s;
    }

    &__header {
        /*-ctag-example: ...
            { .EXP-Page__title }
            { .EXP-Page__button }
        */
        .fill-width;
        .height-row-2;
        .float-left;
        .h-padding-col-half;

        .breakpoint-small-h-padding-col-quarter;

        .skinny-h-padding-col-quarter;

        &__title {
            /*-ctag-example: ...Page Title;*/
            .fill-height;
            .flex-vcenter;
            .float-left;
            .font-size-largest;
            .text-color-grey-3;

            .skinny-font-size-larger;
            .skinny-width-col-1-half;
        }

        &__button {
            /*-ctag-example: <div class='EXP-Page__header__button map'></div>;*/
            width: 50px;
            .fill-height;
            .float-right;
            .flex-center;
            .interactive;


            &:hover {
                .background-grey-9;
            }

            &.filter {
                background-image: url("_export/filter_icon.png");
            }
            &.map {
                background-image: url("_export/map_icon.png");
            }
            &.search {
                background-image: url("_export/search_icon.png");
            }

        }
    }
}

