EXP-advisor.css_string:
.EXP-advisor {
    /*-ctag-example: ...
            { .EXP-advisor__exampleMainNavContainer  }
            { .EXP-advisor__advisorMainNavContainer  }
            { .EXP-advisor__pageContainer  }
    */
    .fill-container;

    &__exampleMainNavContainer {
        /*-ctag-example: <div ... style='background-color: #eee;'></div>*/
        .fill-width;
        .height-row-1-half;
        .position-top-left;

        .breakpoint-small-height-row;
    }

    &__advisorMainNavContainer {
        /*-ctag-example: <div ... style='background-color: #aaa;'></div>*/
        .width-col-3;
        .height-minus-row-1-half;
        .position-bottom-left;

        transition: width .3s;

        .breakpoint-small-width-col-12;
        .breakpoint-small-height-minus-row;

        .skinny-width-col-1;
    }

    &__pageContainer {
        /*-ctag-example: <div ... style='background-color: #999;'></div>*/
        .width-col-9;
        .height-minus-row-1-half;
        .left-col-3; .top-row-1-half;

        transition: left .3s;

        .breakpoint-small-position-left;
        .breakpoint-small-left-col-0;
        .breakpoint-small-top-row;
        .breakpoint-small-height-minus-row;
        .breakpoint-small-width-col-12;

        .skinny-width-col-3;
        .skinny-left-col-1;
    }

}

AdvisorNav.css_string:
.AdvisorNav {
    /*-ctag-example: ...
            { .AdvisorNav__titleLink  }
            { .AdvisorNav__link  }
            { .AdvisorNav__link  }
            { .AdvisorNav__link  }

            { .AdvisorNav__seasonLink  }
    */
    .fill-container;
    .background-example-yellow;

    &--yellow {

    }

    &__titleLink {
        /*-ctag-example: ...
            <div class='skinny-display-none'>Organizaations</div>
            <div class='display-none
                        skinny-display-block'>Org</div>
        */
        .interactive;
        .fill-width;
        .height-row-2;
        .flex-vcenter;
        .font-size-larger;
        color: @example-yellow-darkest;
        .single-line;

        background-image: url("_export/advisor_icon.png");
        background-position: @col-quarter center;
        padding-left: 60px;

        .skinny & {
            background-position: center;
        }

        &:hover {
            .background-example-yellow-light;
        }
    }

    &__link {
        /*-ctag-example: ...<div>Notifications</div>*/
        .interactive;
        .fill-width;
        .height-row-1-half;
        .flex-vcenter;
        .h-padding-col-quarter;
        .font-size-large;
        color: @example-yellow-darkest;
        .single-line;

        .skinny & {
            .font-size
        }

        &:hover {
            .background-example-yellow-light;
        }
    }

    &__seasonLink {
        /*-ctag-example: ...<div>2015 Data</div>*/
        .interactive;
        .fill-width; .height-row-1-half;
        .flex-vcenter;
        .h-padding-col-quarter;
        .position-bottom-left;
        .background-grey-10;
        .font-size-large;
        .text-color-grey-3;

        &:hover {
            .background-grey-9;
        }
    }
}

ExampleMainNav.css_string:
.ExampleMainNav {
    .fill-container;
    .background-example-blue;
    .text-color-grey-10;

    &__separator { // goes inside element that is to have a separator
        /*-ctag-example: ...*/
        width: 1px; height: 60%;
        position: absolute;
        top: 20%;
        background-color: rgba( 255,255,255, .3);
    }

    &__logo {
        /*-ctag-example: ...*/
        .width-col-2;
        .fill-height;
        .float-left;
        .interactive;

        background-image: url("_export/connectedfarm_logo.png");
        background-size: contain;
        background-position: center;
    }

    &__appNav {
        /*-ctag-example: ...{ .ExampleMainNav__appNav__label }*/
        .width-col-5-half;
        .fill-height;
        .float-left;
        .interactive;
        .font-size-large;
        .flex-vcenter;
        .v-padding-row-half;

        .breakpoint-medium-width-col-4-half;

        &__label {
            /*-ctag-example: ...Application Name*/
            .single-line;
            .h-padding-col-quarter;
            .v-padding-row-quarter;
        }
    }

    &__notifications {
        /*-ctag-example: ...*/
        .width-col-1;
        .fill-height;
        .background-example-yellow;
        .float-left;
        .interactive;

        .breakpoint-medium-width-col-2;
        .breakpoint-small-width-col-2;

        background-image: url("_export/notifications_icon.png");
        background-size: contain;
    }

    &__upgrade {
        /*-ctag-example: ...
            { .ExampleMainNav__upgrade__label }
            { .ExampleMainNav__separator }*/
        .width-col-1;
        .fill-height;
        .float-left;
        .interactive;
        .flex-center;

        .breakpoint-medium-display-none;
        .breakpoint-small-display-none;

        &__label {
            /*-ctag-example: ...*/
            .single-line;
            .h-padding-col-quarter;

            happy: 8.33333vw * .25;
            happy2: @col-quarter;
        }
    }

    &__user {
        /*-ctag-example: ...<div>joe@example.com</div>*/
        .width-col-2-half;
        .fill-height;
        .float-left;
        .interactive;
        .text-align-left;
        .flex-vcenter;
        .h-padding-col-quarter;

        .breakpoint-medium-width-col-3;
        .breakpoint-small-width-col-3;

        .breakpoint-medium-font-size-small;
        .breakpoint-small-font-size-small;

        & > * {
            overflow: hidden;
            white-space: nowrap;
        }
    }
}
